import './styles/Header.css';
import {Route, Link, Routes } from 'react-router-dom';

function Header() {
    return (
      <>
        <div className="header">
            <Link href="/home"><img src={require('../assets/logo/csmarket.png')}/></Link> 
            <div className="topnav">
              <Routes>
                <Route href="/Opencase">Opencase</Route>
                <Route href="/Upgrade">Upgrade</Route>
              </Routes>
            </div>
            <Link href="/login" className="btn">Login via steam</Link>
      </div>
      </>
      
    );
}

export default Header;
